INSERT INTO `post` VALUES (1,'Mapas auto-organizáveis são um modelo de rede neural artificial, também conhecido como SOM, que pode ser aplicado de forma satisfatória quando se deseja criar sistemas capazes de aprender conforme a geometria dos objetos à serem reconhecidos automaticamente.','2012-02-06 18:00:12',23,1),(2,'Já encontrei uma solução!\nA partir do centro da tela, representei três eixos lógicos que correspondem as coordenadas X, Y e Z respectivamente, onde, cada coordenada é dada pela distância entre o ponto correspondente ao centro da tela e o ponto que corresponda a outra extremidade do eixo.','2012-02-06 18:00:12',23,4),(3,'Oi maria.\n\nEu também acredito na Computação em Nuvem como uma tendência. Creio que no futuro, além dos Sistemas Operacionais atuais se tornarem mais leves, vários outros serviços serão disponibilizados de maneira que o usuário do serviço não precise ter controle de qual servidor hospeda o provedor do serviço.','2012-02-06 18:00:12',23,5),(4,'Pessoal.\n\nNa minha opinião, ao se falar de Cloud Computing, devemos considerar também aspectos como: Tolerância a falhas, replicação, interoperabilidade, etc.\n\nIsso, sem contar em aspectos de segurança da informação. A final, os dados estarão em rede. Como fazer o controle de acesso? Como controlar recursos sob demanda?','2012-01-29 22:45:58',6,5),(5,'Em pascal, se não me engano, para uma variável do tipo integer, são alocados 16 bits de memória, o que corresponde a 2^16 (ou 2 elevado a 16) representações diferentes de números. Como o tipo integer também envolve números negativos, ficam (2^16)/2 números negativos, ((2^16)/2)-1 números positivos e o elemento neutro (O Zero). Isso significa que, números inteiros em pascal variam de acordo com a faixa de valores -32768 à 32767.','2012-01-29 22:58:08',6,3),(6,'Em pascal são 2 bytes de memória para variáveis do tipo inteiro. Em Java, se são 4 bytes para variáveis tipo int, deve seguir mesma lógica do post anterior. Isto é, 4 bytes correspondem a 32 bits, capacidade necessária para representar até 2^32 números diferentes, incluindo números positivos, negativos e o zero.\n\nClaro, se a JVM aloca mais ou menos que 4 bytes para variáveis tipo inteiro, basta seguir essa lógica para determinar a faixa de valores que podem ser representados em variáveis tipo int em Java!','2012-01-29 23:05:05',6,3),(7,'Só complementando...\n\nLi também sobre os benefícios ao desenvolvimento muscular relacionados a influência das reações químicas impulsionadas pelo metabolismo acelerado. Entendi que, se tais reações químicas acontecem desde o início da mastigação, quando o alimento a ser digerido se mistura com a saliva, o que causa uma transformação química no alimento ao formar o bolo alimentar, até a absorção do alimento pelo organismo quando os nutrientes chegam a corrente sanguínea através das paredes do intestino.','2012-01-29 23:24:01',16,6),(8,'Oi Marcia!\n\nTambém entendi que o metabolismo acelerado nada mais é do que a produção de enzimas acelerada que impulsiona que ocorram as reações químicas necessárias à tornar o alimento que ingerimos pronto para ser absorvido pelo organismos. Isto é, considero essa absorção como o lançamento dos nutrientes na corrente sanguínea após os mesmos atravessarem as paredes do intestino.\n\nInclusive, cada órgão de nosso corpo absorve os nutrientes de que necessita para manter-se saudável e funcionando.','2012-02-15 08:27:10',23,6),(9,'Complementando...  Infelizmente ainda existe a limitação de 512 caracteres por post!\n\nDurante a prática de exercícios físicos, o coração também bombeia o sangue mais rápido, o que aumenta a velocidade com que o sangue circula, tornando mais rápida a absorção de nutrientes pelos órgãos que compõem nosso organismo. ','2012-02-15 08:27:51',23,6),(10,'xxx','2017-04-29 14:45:39',2,6),(11,'abd','2021-07-21 17:45:15',2,6),(12,'ABC','2021-07-21 19:36:23',2,5);
/*!40000 ALTER TABLE `post` ENABLE KEYS */;
UNLOCK TABLES;

