INSERT INTO `topic` VALUES (1,'Qual modelo de rede neural mais adequado à aplicação no reconhecimento de caracteres manuscritos?','2012-01-15 18:06:30',23,4),(2,'Quais padrões de projeto mais indicados ao desacoplamento de módulos de um sistema computacional?','2012-01-16 18:06:30',23,4),(3,'Qual a capacidade máxima em memória de uma variável tipo \"int\" da linguagem de programação Java?','2012-01-17 18:06:30',23,4),(4,'Oi pessoal!\nPreciso projetar objetos tridimensionais na tela de um computador. Utilizei uma representação em coordenadas cartesianas, porem, preciso encontrar uma forma de representar essas coordenadas tridimensionais em 2D para projeta-las na tela do computador. Como calcular a representação em 2D das coordenadas tridimensionais?','2012-01-18 18:06:30',23,4),(5,'Em minhas pesquisas de rotina, encontrei um artigo que destacou Cloud Computing (Computação em nuvem) como uma tendência. Estima-se que, no futuro, os sistemas operacionais convencionais funcionarão com um mínimo de recursos disponíveis localmente. Isto é, dados hoje armazenados em Disco Rígido e operações executadas em Unidade Central de Processamento local pertencerão a \"nuvens\" de computadores conectados e interoperáveis de forma a prover tal nível de abstração.\n\nO que vocês acham sobre essa tendência?','2012-01-19 18:06:30',4,4),(6,'Oi pessoal!\n\nGosto de pesquisar sobre biologia de vez em quando. Esses dias, encontrei um material que aborda a prática de execícios físicos como forma de estimular o metabolismo, de forma que, nossa digestão acontece com mais facilidade e rapidez. Gostaria de compreender a relação com a produção de enzimas e reações químicas necessárias no processo digestório.','2012-01-20 18:06:30',16,4);
/*!40000 ALTER TABLE `topic` ENABLE KEYS */;
